import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="top-bar">FREE SHIPPING ON ALL ORDERS ABOVE Rs 1099/-</div>
      <nav>
        <ul>
          <li><Link to="/Home">HOME</Link></li> {/* Navigates to the home page */}
          <li><Link to="/ProductCard">SHOP</Link></li> {/* Update the path if needed */}
          <li><Link to="/about-us">ABOUT</Link></li> {/* Navigates to the About Us page */}
          <li><Link to="/faqs">FAQs</Link></li> {/* Update the path if needed */}
          <li><Link to="/connect">CONNECT</Link></li> {/* Update the path if needed */}
        </ul>
      </nav>
    </header>
  );
};

export default Header;
